import Link from 'next/link'
import Layout from '../components/Layout'

export default () => (
    <Layout title={'Index'}>
        <div className='container'>
            <div className='nav'>INDEX PAGES</div>
        </div>

        <style jsx Global>
            {`
                .container{
                    width:100%;
                    height:auto;
                }
                .nav{
                    width:100%;
                    height:90px;
                    background-color:rgba(0,0,0,0.2);
                    position:fixed;
                    top:0;
                    left:0;
                }
               
            `}
        </style>
    </Layout>
)
